import React from 'react';

function TwoSubApp2(props) {
    return (
        <div style={{width:'500px'}}>
            <h4>TwoSubApp2</h4>
            <div>
                <b>색상선택:</b>
                <input type='color' defaultValue='cadetblue'/>
            </div>
        </div>
    );
}

export default TwoSubApp2;
